window.bookSummaryJSON = "<p><b>Can you call someone an enemy if you haven’t seen them for the better part of a decade?</b></p> <p>Deacon Black is perfectly content with the status quo - work, sleep, repeat. Who cares if he’s rigid, structured, and set in his ways? <br> It’s a job requirement that keeps his men safe and his company’s doors open.</p> <p>One phone call is all it takes to upend his life and land him right back into a past he has tried to forget.</p> <p>Revisiting old ghosts is the last thing he needs.</p> <p>Especially when the forced trip down memory lane includes the only woman he never wanted to see again.</p> <p>Annalise Grimaldi hit the jackpot with her life - from her trust fund to her best friend, she has it all.</p> <p>But her world comes crashing to a halt when her best friend vanishes - leaving behind an apartment in tatters and more questions than answers.</p> <p>There’s only one person she can think of that can help in a situation like this.</p> <p>She hates to make the call, but there isn’t a thing she wouldn’t do to make sure her friend is found.</p> <p>Even setting aside her hatred for Deacon Black.</p>"; 
